import "./App.css";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Navbar from "./components/Navbar";
import Reg from "./pages/Reg";
import Home from "./pages/Home";
import Rolunk from "./pages/Rolunk";
import Login from "./pages/Login";
import Autok from "./pages/Autok";



function App() {

  return (
    <Router>
      { <Navbar /> }
      <Routes>
        <Route  className="links"  path="/home" element={<Home />} />
        <Route className="links"  routeName="reg" path="/reg" element={<Reg />} />
        <Route className="links"  routeName="login" path="/login" element={<Login />} />
        <Routev path="/rolunk" element={<Rolunk />} />
        <Route path="/autok" element={<Autok />} />
      </Routes>
    </Router>
  );
}

export default App;
